,"englishTitle":null,"opRecommend":false,"recommendInfo":null,"subscribedCount":31992,"cloudTrackCount":0,"userId":302065359,"totalDuration":0,"coverImgId":109951166487367000,"privacy":0,"trackUpdateTime":1650770238895,"trackCount":42,"updateTime":1643170524800,"commentThreadId":"A_PL_0_720394283","coverImgUrl":"https://p1.music.126.net/uS7JkYA5wD1q1Xrnu6cURQ==/109951166487367002.jpg","specialType":0,"anonimous":false,"createTime":1494131080610,"highQuality":false,"newImported":false,"trackNumberUpdateTime":1643170524800,"playCount":908593,"adType":0,"description":"☞先看简介☜音乐会乐曲完整收录（已排序）\n2022.1.26更新闪耀群星2发布补充之前缺的优菈和魈，制作不易收藏分享感谢~~~ ❤️❤️❤️\n修改简介说明：（添加了每部分前的解说，删除了每部分的英文和部分歌后面的个人说明）\n补充说明在评论，简介真的写不下了~那么旅行者开始\nヾ(✿ﾟ▽ﾟ)ノ\n①旅行者，欢迎来到原神线上音乐会2021。伴随音乐，「提瓦特」奇妙的幻想世界，为你敞开...\n一、原神\n二、酒与牧歌之风\n【无】蒙德(音乐会完整版）\n快乐的旅程\n无虑无猜的岁月(可莉)\n②白垩与真红相伴，浪沫在诗篇中起舞。自由之城的节奏，在现代舞台上律动。\n三、传奇的流风\n白皑中的冥想(阿贝多)\n真红骑士，出发(可莉)\n浪沫起舞(优菈)\n诗人的工作(温迪)\n③不妨到晨曦酒庄小坐，品评蒙德的名酒佳酿。\n四、光辉的涨落\n微醺的回忆(迪卢克)\n炉边小憩\n光辉的涨落\n骑士的义举\n④蒙德城的日与夜，循环往复。三三两两，小聚馆中，有诗，有酒，正是微醺好时候...\n五、风中之城\n风所爱之城\n蒙德的黄昏\n星光下的蒙德\n蒙德的又一日\n天使的馈赠\n⑤风神护佑的教堂，响起古老的颂歌，星夜映照的山崖，回荡千年的哀伤...\n六、果酒的余韵\n风带来的圣歌\n午日的眺望\n战斗的秘仪 (蒙德战斗音乐)\n平原的边际\n⑥灯影阑珊，月上高台，璃月港昼俊不停吞吐天下财富...\n七、匣中琉璃云间月\n南港的闲暇\n北国的宝库\n沉睡的往昔\n鲜衣游侠 (璃月战斗音乐)\n⑦回想这旅途一程，有天空海阔，有跋山涉水。有伙伴相随，又怎惧急危?\n八、冒险的旅途\n捕风的异乡人\n女士驾临\n凶险的密谋\n冲啊！无畏的勇士\n⑧霆霓收势，夜叉傩舞，麒麟展臂，岩王信步。正是一卷《璃月英雄谱》\n九、璨璨星华\n霆霓快雨(刻晴)\n捷疾之业(魈)\n麟跃幽岩 (甘雨)\n尘世闲游(钟离)\n⑨那时，被腐蚀的龙，孤独地盘踞废墟，回想好时候，曾有诗人的吟唱，众人的敬爱...\n十、悠古的回望\n风暴，高塔与圣地\n终天的闭幕曲\n⑩「这下还不赖，值得我再认真一点。」\n十一、埃阿斯的回信\n埃阿斯的回信（达达利亚)\n永无谢幕的演出\n⑪那时，旧日的魔神复苏，危机迫近璃月海港\n十二、突破怒浪的勇者\n直面纷争的狂喜\n斩破风暴的魔鲸\n同旋涡共舞\n⑫旅途还在继续，未知的危险潜藏其中...\n十三、勇气的战记\n亘古的韵律\n无数的逆境\n十四、命定的离别\n(我相信，在旅途的终点，我们终将重逢…)❤️","tags":["轻音乐","游戏","ACG"],"ordered":true,"status":0,"name":"《原神》线上音乐会2021「无际之旅的旋律」","id":720394283,"coverImgId_str":"109951166487367002","sharedUsers":null,"shareStatus":null},{"subscribers":[],"subscribed":false,"creator":{"defaultAvatar":false,"province":620000,"authStatus":0,"followed":false,"avatarUrl":"http://p1.music.126.net/hriD8ciUUIoLBHexmYTG2g