E D'AMOUR”，直译过来应该是“基于爱情的婚姻”。 这首曲子是法国作曲家及音乐制作人保罗·塞内维尔和奥立佛·图森为理查德·克莱德曼量身定制的，出自理查德·克莱德曼的《水边的阿狄丽娜》。带有一点忧伤。\nNO.2 《秋日私语》\n原名：A comme amour，中文名称又叫《秋的喁语》。是法国作曲家保罗·塞内维尔和奥立佛·图森，他们是法国达芬唱片公司两个负责人，也是著名作曲家，曲是他们两个写的，理查德·克莱得曼是原演奏者\nNO.3 《水边的阿狄丽娜》\n法文名：Ballade pour Adeline（给爱德琳的诗）是保罗·塞内维尔所作，理查德·克莱德曼演奏的歌曲。1990年，理查德·克莱德曼以演奏作曲家兼经纪人Olivier Toussaint改编版的《给爱德琳的诗》获得唯一的金钢琴奖\nNO.4 《蓝色多瑙河》\n蓝色多瑙河圆舞曲，奥地利作曲家小约翰·施特劳斯创作于1866年。原为一首由乐队伴奏的男声合唱,后去掉人声,成为一首独立的管弦乐曲。由小序曲、五段小圆舞曲及一个较长大的尾声连续演奏而成\nNO.5 《致爱丽丝》\n德国音乐家贝多芬作于1810年4月27日，德国音乐学家诺尔发现此谱，于1876年公诸于世，将“特雷泽”误认“爱丽丝”。乐曲旋律清新明快，犹如涓涓山泉在歌唱\nNO.6 《悲怆奏鸣曲》\n德国作曲家贝多芬作品第13号，创作于1798年至1799年初，作品献赠给他的赞助人与仰慕者利赫诺夫斯基王子。本曲是贝多芬早期钢琴奏鸣曲之顶峰的杰作，也是因其戏剧性的优美旋律而为世人所熟悉的作品。\nNO.7 《蓝色的爱》\n《爱是忧郁》原来出自法国，乐曲作者是安德列·帕普。1968年，经保罗·莫里哀的改编，成为著名钢琴曲。\nNO.8 《雨的印记》\nKiss The Rain ，出自韩国音乐家YIRUMA之手。 为4/4拍子，降A大调，曲子的节奏以及右手高音部分描写屋檐滴低落雨滴的感觉，和屋檐下等待自己美好的爱情。\nNO.9 《杜鹃圆舞曲》\n根据挪威作曲家约纳森创作的一首同名钢琴曲移植的手风琴曲。全曲采用三拍子圆舞曲体裁，C大调，中板，由三个小圆舞曲组成。\nNO.10 《爱的纪念》\n法文名为Souvenirs d'enfance ，是由理查德·克莱德曼演奏的钢琴名曲。\n图片、资料源于网络、书籍\n以上排名不分先后\n不涉及古典","tags":["轻音乐","钢琴","夜晚"],"ordered":true,"status":0,"name":"纯音•世界名钢琴曲","id":144818129,"coverImgId_str":null,"sharedUsers":null,"shareStatus":null},{"subscribers":[],"subscribed":false,"creator":{"defaultAvatar":false,"province":510000,"authStatus":0,"followed":false,"avatarUrl":"http://p1.music.126.net/Nqc4ELgmXYQaX3ri1GHoig==/109951162994151743.jpg","accountStatus":0,"gender":1,"city":510100,"birthday":0,"userId":64421766,"userType":200,"nickname":"四月晓尘","signature":"我永远喜欢珂朵莉.jpg。失踪人口再次失踪。主食日语、ACG的怠惰单主，更新动态话题#【神级bgm】#。~欢迎私信提供素材～","description":"","detailDescription":"","avatarImgId":109951162994151740,"backgroundImgId":18912699509627144,"backgroundUrl":"http://p1.music.126.net/DFQij7d0S96rpAMT8y4kDw==/18912699509627143.jpg","authority":0,"mutual":false,"expertTags":["日语","ACG"],"experts":null,"djStatus":10,"vipType":11,"remarkName":null,"authenticationTypes":64,"avatarDetail":null,"avatarImgIdStr":"109951162994151743","backgroundImgIdStr":"18912699509627143","anchor":false,"avatarImgId_str":